import { Box, Button, Flex,Image,Link } from "@chakra-ui/react";
import Logo from '../assets/Logo.png'
import { HeaderLinks } from "../utils";
export default function Header() {
	return(
		<Box width={{base: '95%', xl: '1320px'}} m={'0 auto'} py={{base: '0.5rem', md: '1rem', lg: '1.4', xl: '1.8rem'}}>
			<Flex width={'100%'}  justifyContent={'space-between'} alignItems={'center'}>
				<Flex gap={'0.6rem'} alignItems={'center'}>
					<Image src={Logo} width={'2.4rem'} height={'2.4rem'} mr={'1.4rem'}/>
					{HeaderLinks.map(item => {
						return <Link px={'1.6rem'} py={'1rem'} href={item.url} key={item.name} _hover={{}}>{item.name}</Link>
					})}
				</Flex>
				<Flex>
					<Button variant={'normal'} padding={{base: '1.5rem 1rem', sm: '1.8rem 2rem', md: '2rem 4rem', lg: '2.2rem 5rem', xl: '2.4rem 6rem'}} onClick={() => {}}>Trade Now</Button>
				</Flex>
			</Flex>
		</Box>
	)
}
